const canvas = document.getElementById("canvas");
const ctx = canvas.getContext("2d");
canvas.width = window.innerWidth;
canvas.height = window.innerHeight;

let particlesArray;

let mouse = {
    x: null,
    y: null,
    radius: 100,
};
window.addEventListener("mousemove", function (e) {
    mouse.x = e.x;
    mouse.y = e.y;
});

// Draw image function
function drawImage() {
    let imageWidth = png.width || png.naturalWidth;
    let imageHeight = png.height || png.naturalHeight;
    const data = ctx.getImageData(0, 0, imageWidth, imageHeight);
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    class Particles {
        constructor(x, y, color, size) {
            this.x = x + canvas.width / 2 - png.width * 2;
            this.y = y + canvas.height / 2 - png.height * 2;
            this.color = color;
            this.size = size;
            this.baseX = x + canvas.width / 2 - png.width * 2;
            this.baseY = y + canvas.height / 2 - png.height * 2;
            this.density = Math.random() * 50 + 10;
        }
        draw() {
            ctx.beginPath();
            ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2, false);
            ctx.closePath();
            ctx.fill();
        }
        update() {
            ctx.fillStyle = this.color;

            let dx = mouse.x - this.x;
            let dy = mouse.y - this.y;
            let distance = Math.sqrt(dx * dx + dy * dy);
            let forceDirectionX = dx / distance;
            let forceDirectionY = dy / distance;

            let maxDistance = 100;
            var force = (maxDistance - distance) / maxDistance;

            if (force < 0) {
                force = 0;
            }

            let directionX = forceDirectionX * force * this.density * 0.9;
            let directionY = forceDirectionY * force * this.density * 0.9;

            if (distance < mouse.radius + this.size) {
                this.x -= directionX;
                this.y -= directionY;
            } else {
                if (this.x !== this.baseX) {
                    let dx = this.x - this.baseX;
                    this.x -= dx / 5;
                }
                if (this.y !== this.baseY) {
                    let dy = this.y - this.baseY;
                    this.y -= dy / 5;
                }
            }
            this.draw();
        }
    }
    function init() {
        particlesArray = [];
        for (let y = 0, y2 = data.height; y < y2; y++) {
            for (let x = 0, x2 = data.width; x < x2; x++) {
                if (data.data[y * 4 * data.width + x * 4 + 3] > 128) {
                    let positionX = x;
                    let positionY = y;
                    let color =
                        "rgb(" +
                        data.data[y * 4 * data.width + x * 4] +
                        ", " +
                        data.data[y * 4 * data.width + x * 4 + 1] +
                        ", " +
                        data.data[y * 4 * data.width + x * 4 + 2] +
                        ")";

                    particlesArray.push(
                        new Particles(positionX * 4, positionY * 4, color, 4)
                    );
                }
            }
        }
    }

    function animate() {
        requestAnimationFrame(animate);
        ctx.fillStyle = "rgba(255, 255, 255, .1)";
        ctx.fillRect(0, 0, innerWidth, innerHeight);

        for (let i = 0; i < particlesArray.length; i++) {
            particlesArray[i].update();
        }
    }
    init();
    animate();
    window.addEventListener("resize", function () {
        canvas.width = innerWidth;
        canvas.height = innerHeight;
        init();
    });
    window.addEventListener("mouseout", function () {
        mouse.x = undefined;
        mouse.y = undefined;
    });
}

var png = new Image();
png.src =
    "data:image/png;base64,";

window.addEventListener("load", () => {
    ctx.drawImage(png, 0, 0);
    drawImage();
});
